import React, { useState } from 'react'
import './login.css'
import Axios from 'axios';
import { Navbar } from 'react-bootstrap'


export default function Login() {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");

    const axios = Axios.create({
        baseURL: 'http://0.0.0.0:8080'
    })
    var loginRequest = () => {
        axios.post('/login', {
            data: {
                username: username,
                password: password
            }
        })
            .catch(e => {
            })
            .then((res) => {
                if (res && res.status === 200) {
                    sessionStorage.setItem('userLoggedIn', true)
                    window.location = '/'
                } else {
                    alert('Invalid credentials. Please try again.')
                }
            })
    }

    return (
        <div className="wrapper fadeInDown">
            <Navbar bg='dark' variant='dark' expand='lg' sticky='top'>
                <Navbar.Brand>Home</Navbar.Brand>
                <div id="formContent">
                    <h2 className="active"> Sign In </h2>

                    <div className="fadeIn first">
                    </div>
                    <form>
                        <input type="text" id="username" className="fadeIn second" name="login" placeholder="Username" onChange={e => {
                            setUsername(e.target.value);
                        }} />
                        <input type="text" id="password" type="password" className="fadeIn third" name="login" placeholder="Password" onChange={e => {
                            setPassword(e.target.value);
                        }} />
                        <input type="button" className="fadeIn fourth" value="Log In" onClick={loginRequest} />
                    </form>
                </div>
            </Navbar>
        </div>
    )

}
